import React from "react";
import {MDBBtn,MDBTable,MDBTableBody,} from "mdb-react-ui-kit";



const Filter = (props) => {
    return (
      <>
      {

        props.searchfilter==='isDone'
            ?props.props.todos.filter((todo) => {
            return todo.isDone === true;
                 }) .map((todo, i) => {
               return (  
                         <MDBTable className="mb-4">
    <MDBTableBody>
      <tr>
        <th scope="row">1</th>
        <td>Buy groceries for next week</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>
        </td>
      </tr>
      <tr>
        <th scope="row">2</th>
        <td>Renew car insurance</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>
        </td>
      </tr>
      <tr>
        <th scope="row">3</th>
        <td>Sign up for online course</td>
        <td>In progress</td>
        <td>
          <MDBBtn type="submit" color="danger">
            Delete
          </MDBBtn>

          <MDBBtn type="submit" color="success" className="ms-1">
            Finished
          </MDBBtn>
        </td>
      </tr>
    </MDBTableBody>
                         </MDBTable>
                      );
                      }) 

          : searchfilter === "Not-Yet" ? props.todos
      .filter((todo) => {
        return todo.isDone === false;
      })
      .map((todo, i) => (
        <ListGroup
        as="ol"
        onMouseEnter={() => handleMouseEnter(i)}
        key={i}
      >
        <ListGroup.Item
          as="li"
          className="d-flex justify-content-between align-items-start"
        >
          <span>{i + 1}.</span>
          <div className="ms-2 me-auto">
            <div
              className="fw"
              style={
                todo.isDone ? { textDecoration: "line-through" } : null
              }
            >
              {todo.description}
            </div>
          </div>
          {hover === i ? (
            <>
              <Lightbox
                show={show}
                setShow={setShow}
                todo={todo}
                i={i}
                setHover={setHover}
              />
            </>
          ) : todo.isDone ? (
            <MdDone size={35} color="Green" />
          ) : (
            <IoMdClose size={35} color="red" />
          )}
        </ListGroup.Item>
      </ListGroup>
      ))
      
      
      : props.todos.map((todo, i) => (
        <ListGroup as="ol" onMouseEnter={() => handleMouseEnter(i)} key={i}>
        <ListGroup.Item
          as="li"
          className="d-flex justify-content-between align-items-start"
        >
          <span>{i + 1}.</span>
          <div className="ms-2 me-auto">
            <div
              className="fw"
              style={
                todo.isDone ? { textDecoration: "line-through" } : null
              }
            >
              {todo.description}
            </div>
          </div>
          {hover === i ? (
            <>
              <Lightbox
                show={show}
                setShow={setShow}
                todo={todo}
                i={i}
                setHover={setHover}
              />
            </>
          ) : todo.isDone ? (
            <MdDone size={35} color="Green" />
          ) : (
            <IoMdClose size={35} color="red" />
          )}
        </ListGroup.Item>
      </ListGroup>
             ))}
             </>
           );
         }
         
export default Filter;
